	return (
		<div className='ma4 mt0'>
			<Tilt className="Tilt br2 shadow-2" options={{ max : 55}} style={{ height: 150, width: 150}} >
 	<div className="Tilt-inner pa4">
 		<img style ={{paddingTop: '18px'}}alt = 'logo' src={brain}/>
 	</div>
</Tilt>
		</div>
		);
};

export default Logo;
